import React from "react";

class Menubar extends React.Component{
    render(){
        return(
            <div>
                <div className='logo'>
                    <img className="logoImage" alt="logo" src="img/13.png" />
                </div>                
                <div className='menu'>                       
                    <div>홈</div>
                    <div>미용실</div>
                    <div>예약내역</div>
                    <div>마이페이지</div>
                    <div>로그아웃</div>              
                </div>
            </div>

        )
    
    }
        
}
export default Menubar;
